function addToArrayForm(num, k) {
    let i = num.length - 1, carry = 0;
    let ans = [];
    while (i >= 0 || k || carry) {
        carry += (i < 0 ? 0 : num[i]) + (k % 10);
        let [q, v] = [Math.floor(carry / 10), carry % 10];
        carry = q;
        ans.push(v);
        k = Math.floor(k / 10);
        i--;
    }
    return ans.reverse();
}
